import React from "react";
import logo from "../assets/images/logo.png";

function PrivacyPolicy() {
    return (
        <div>
            <div className="top">
                <img src={logo} className="hero-logo w-[65px]" alt="logo"/>
            </div>
        </div>
    );
};

export default PrivacyPolicy;
